                                </v-card-title>

                                <v-card-text>
                                    <p class=""text-center"">
                                        CONTRATO ADHESION INVERSIONISTA
                                    </p>

                                    <p class=""text-center""> <u>DEFINICIONES</u> </p>

                                    <p class=""text-justify"">
                                        Para todos los efectos y consecuencias derivadas de la aplicacin y alcance de este contrato y con el fin de lograr una correcta y exacta interpretacin de este documento las siguientes palabras, utilizadas en singular o plural, maysculas o minsculas, resaltadas o no, femenino o masculino, y salvo que el contexto lo requiera de otra forma, las palabras o expresiones definidas en singular incluirn su forma plural y viceversa, teniendo todas ellas el nico y exclusivo significado que se indica a");
            WriteLiteral(@" continuacin:
                                    </p>
                                    <p class=""text-justify"">
                                        EL BANCO: Corresponde a la persona jurdica confirmante de la operacin, la cual garantiza el pago a EL INVERSIONISTA ganador de la operacin de confirming (pago a proveedores), una vez que llegue(n) al vencimiento la(s) factura(s) por la que haya ofertado.
                                    </p>
                                    <p class=""text-justify"">
                                        EMPRESA: Corresponde a la sociedad mercantil <b>TUFACTORING SERVICIOS C.A.</b> domiciliada en la ciudad de Caracas, Distrito Capital, constituida por documento inscrito por ante el Registro Mercantil xx de la Circunscripcin Judicial del Distrito Capital y Estado Miranda, en fecha xxxxx de xxxxxx de xxxxx, bajo el N. xx, Tomo xxxxxx.
                                    </p>
                                    <p class=""text-justify"">
                   ");
            WriteLiteral(@"                     SISTEMA TUFACTORING ( Sistema): Corresponde a un Desarrollo Tecnolgico que permite a EL CLIENTE, a travs del uso de los canales de banca por internet, realizar operaciones de registro, venta, compra, ordenar el pago o ceder Facturas de sus proveedores, as como intercambiar informacin exclusivamente relacionada con dichas Facturas.
                                    </p>
                                    <p class=""text-justify"">
                                        INVERSIONISTA. Es la persona natural o jurdica que se convierte en acreedora de El CLIENTE como consecuencia de transacciones de compra de Facturas expedidas por EL PROVEEDOR originario, y a favor de quien este ltimo acepta su cesin una vez que acepta el descuento ofertado por el Valor Neto de la factura subastada.
                                    </p>
                                    <p class=""text-justify"">
                                        EL CLIENTE: Es la persona natural o jurdica titular de");
            WriteLiteral(@" una cuenta o de cualquier otro servicio o producto ofrecido por EL BANCO quien, luego de cumplir las formalidades propias de afiliacin al sistema de Banca Electrnica o Banca por Internet, particularmente al Sistema TuFactoring, conforme al procedimiento sealado a tal efecto por EL BANCO, quien, siendo aceptante o deudor de una o varias facturas, registre dichos instrumentos en el Sistema de manera que pudieran ser objeto de subasta para el pago anticipado de las mismas a sus proveedores.
                                    </p>
                                    <p class=""text-justify"">
                                        PROVEEDOR. Es la persona natural o jurdica acreedora de EL CLIENTE como consecuencia de transacciones comerciales consistentes en la venta o suministro de bienes y/o servicios, por lo cual ha expedido una Factura cuyo pago est a cargo de EL CLIENTE.
                                    </p>
                                    <p class=""text-justify"">
                         ");
            WriteLiteral(@"               DESCUENTO: A los nicos efectos de este contrato, corresponde a la cantidad resultante de aplicar la siguiente frmula, al momento de efectuar las operaciones de venta de factura a travs del Sistema:
                                    </p>
                                    <p class=""text-justify"">
                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(VNXTD)<br />
                                        D=_________ND<br />
                                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(360)

                                    </p>
                                    <p class=""text-justify"">
                                        Donde ""D"" significa Descuento, ""VN"" significa Valor Neto, ""TD"" significa Tasa de Descuento; ""ND"" significa el nmero de das que resulte de sumar los das naturales desde e inclusive la fecha en que se entregue al Proveedor el Precio de venta, respecto de un Derecho Adquirido, hasta inclusive la fecha de vencimiento de d");
            WriteLiteral(@"icho derecho de Crdito.
                                    </p>
                                    <p class=""text-justify"">
                                        TASA DE DESCUENTO: Corresponde a la tasa aceptada por EL PROVEEDOR para determinar el Descuento que se va a aplicar al Valor Neto de la factura subastada, entre las distintas ofertas realizadas por los distintos inversionistas participantes durante horario en que se encuentre activo el Mercado Electrnico. El clculo del Descuento se realizar desde la fecha en que se efecte el anticipo de fondos, hasta la fecha del vencimiento de la Factura.
                                    </p>
                                    <p class=""text-justify"">
                                        FACTURA: Corresponde al documento o ttulo de carcter mercantil contentivo de una obligacin de pago con ocasin de la adquisicin de bienes o servicios por parte de EL CLIENTE.
                                    </p>
                                    <p ");
            WriteLiteral(@"class=""text-justify"">
                                        VALOR NETO. Se refiere al monto resultante de restar al valor numrico expresado en el texto de la Factura todos los tributos o retenciones a los que hubiere lugar, incluso las notas de crdito, si existiesen. Debe ser cargado por EL CLIENTE en el Sistema. En el caso del pago al vencimiento, EL BANCO podr proceder a pagar dicho valor a EL PROVEEDOR o a EL INVERSIONISTA y, en caso de haberla comprado EL BANCO, retirar el monto correspondiente de la(s) cuenta(s) de EL CLIENTE o imputarlo a la lnea de crdito correspondiente, de ser el caso.
                                    </p>
                                    <p class=""text-justify"">
                                        PRECIO DE VENTA: Corresponde al resultado de haber deducido del valor neto de las facturas, antes explicado, la tasa de descuento ofertada por EL INVERSIONISTA ganador en la respectiva operacin, y la cual fue aceptada por EL PROVEEDOR.
                               ");
            WriteLiteral(@"     </p>
                                    <p class=""text-justify"">
                                        CLAVES DE ACCESO: Corresponde a un mecanismo de Seguridad de la Informacin Electrnica, constante de factores de autenticacin tendentes a verificar la identidad de EL CLIENTE y de EL BANCO y la cualidad de stos para realizar las operaciones propias del SISTEMA TUFACTORING. Estos factores de autenticacin correspondern a aquellos establecidos como Factor de autenticacin categoras 2 y 3 de acuerdo a la Resolucin N 641.10 emanada de la Superintendencia de las Instituciones del Sector Bancario (SUDEBAN) contentiva de las Normas que Regulan el Uso de los Servicios de la Banca Electrnica, publicada en la Gaceta Oficial de la Repblica Bolivariana de Venezuela N 39.597 de fecha 19 de enero de 2011.
                                    </p>
                                    <p class=""text-justify"">
                                        DAS HBILES BANCARIOS: Corresponde a los das compre");
            WriteLiteral(@"ndidos entre lunes y viernes que, conforme al calendario bancario, sean laborables para los bancos.
                                    </p>
                                    <p class=""text-justify"">
                                        DERECHO DE CRDITO: corresponde al derecho que tiene el acreedor de una deuda QUE EL CLIENTE tiene obligacin de pagar conforme a la Factura.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA PRIMERA:</b></u> Mediante el registro en el Sistema Tufactoring y la aceptacin del presente contrato de adhesin, EL INVERSIONISTA manifiesta su inters en participar en subastas para la compra de Facturas registradas previamente en el Sistema Tufactoring, en el marco de una operacin de confirming (pago a proveedores). En virtud de ello, EL INVERSIONISTA acepta expresamente las particularidades y condiciones expresadas en este instrumento.
                              ");
            WriteLiteral(@"      </p>
                                    <p class=""text-justify"">
                                        La operacin en la que participara EL INVERSIONISTA consiste en que EL PROVEEDOR (a quien EL INVERSIONISTA podr o no conocer)  una vez que haya aceptado la mejor oferta que arroje el Sistema Tufactoring con base en los descuentos propuestos por los distintos inversionistas, transmitir a favor de EL INVERSIONISTA ganador todos los derechos de crdito inherentes a la factura y EL BANCO garantizar a este ltimo el pago de la factura a su vencimiento por el valor neto que presenta el Sistema.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b> CLUSULA SEGUNDA:</b></u> EL INVERSIONISTA una vez registrado en el sistema, podr participar en el mismo ofertando por la compra de facturas registradas por los clientes de EL BANCO  y autorizadas para su venta por los proveedores respectivos, dentro de los p");
            WriteLiteral(@"armetros que el propio Sistema Tufactoring fija.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA TERCERA:</b></u> EL INVERSIONISTA en caso de no tener operativa una Cuenta en EL BANCO en el cual se depositen todos los importes correspondientes a los fondos provenientes de la liquidacin de la operacin de venta de Facturas, entiende y acepta que el pago del Precio de venta deber realizarse en la cuenta de LA EMPRESA destinada para tal fin en EL BANCO.
                                    </p>
                                    <p class=""text-justify"">
                                        EL INVERSIONISTA asume las tarifas bancarias establecidas por el Banco Central de Venezuela por concepto de transferencia de fondos al momento en que se realice el pago as como impuestos actuales y futuros por concepto de dbitos bancarios. En cualquier caso, de hacerse el pago a travs de una transferencia");
            WriteLiteral(@" por no disponer EL INVERSIONISTA de cuenta en EL BANCO, el Sistema Tufactoring y, por tanto, LA EMPRESA ni EL BANCO sern responsables de cualquier mal funcionamiento del sistema de transferencias bancarias.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA CUARTA:</b></u> EL INVERSIONISTA est en pleno conocimiento que compite en una puja en la que participan otros inversionistas, siendo informado por el sistema en el momento en que su oferta ha sido aceptada por EL PROVEEDOR. En consecuencia, EL INVERSIONISTA acepta que no obstante realice la mejor oferta, EL PROVEEDOR pudiera rechazarla sin que ello motive compensacin ni indemnizacin alguna
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA QUINTA:</b></u> El Precio de venta que pagar EL INVERSIONISTA ganador, ser el que se obtenga en e");
            WriteLiteral(@"l Sistema TuFactoring, aplicando al Valor Neto de la factura la tasa de descuento ofertada EL INVERSIONISTA ganador y aceptada por EL PROVEEDOR.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA SEXTA:</b></u> EL INVERSIONISTA est en conocimiento que EL PROVEEDOR tendr hasta sesenta (60) minutos despus del cierre de la jornada para aceptar la venta, en caso contrario se tendr como rechazada la oferta. En este punto, se indica que el horario del sistema es el siguiente: Para operaciones de consulta las 24 horas del da y los 365 das del ao; para afiliacin en el sistema  o registro de facturas, en los das hbiles bancarios en horario comprendido de 8:00 a.m. a 3:00 p.m.; y para la oferta de facturas, en horario comprendido de 8:00 a.m. a 12:00 p.m.; siempre y cuando no existan fallos o suspensiones del servicio electrnico, elctrico o cualquier otra causa de fuerza mayor que imposibilite su emp");
            WriteLiteral(@"leo.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA SPTIMA:</b></u> EL INVERSIONISTA acepta que bastar slo con la comunicacin que por el Sistema Tufactoring reciba respecto a que su oferta fue aceptada para realizar el pago en un plazo mximo de sesenta (60) minutos. Una vez transcurrido dicho lapso sin que se haya verificado el pago, la operacin queda anulada y EL INVERSIONISTA ser bloqueado en El Sistema, debiendo asumir los gastos administrativos inherentes a la operacin.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA OCTAVA:</b></u> EL BANCO podr verificar en todo momento a las personas naturales o jurdicas que se registren como inversionistas en el Sistema Tufactoring, reservndose el derecho de rechazar su inclusin en el sistema sin necesidad de declaracin o resolucin j");
            WriteLiteral(@"udicial, en caso de que EL INVERSIONISTA sea objeto de medidas o de investigacin por parte de algn organismo o institucin, nacional o internacional, encargado de la Prevencin de legitimacin de capitales o lavado de activos o por cualquier causa que razonablemente pudiera comprometer la seguridad de los clientes de EL BANCO.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA NOVENA:</b></u> EL INVERSIONISTA conoce que EL PROVEEDOR declar la existencia y legitimidad de los Derechos de Crdito Adquiridos y reflejados en la(s) factura(s) por l autorizadas, de conformidad con el artculo 124 del Cdigo de Comercio.
                                    </p>
                                    <p class=""text-justify"">
                                        La informacin e instrucciones suministradas a travs del Sistema Tufactoring, tendrn pleno valor probatorio y fuerza legal para acreditar la op");
            WriteLiteral(@"eracin realizada, el importe de la misma, su naturaleza, as como las caractersticas y alcance de sus instrucciones. EL INVERSIONISTA conoce que el uso de los medios de identificacin previstos en el contrato para realizar operaciones a travs del Sistema, podr equivaler a la firma autgrafa y producir los mismos efectos que las leyes otorgan a los documentos correspondientes.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA DCIMA: </b></u> La aceptacin de la oferta hecha por EL INVERSIONISTA por parte de EL PROVEEDOR y la concrecin del pago dentro del plazo estipulado y en las condiciones determinadas en el presente instrumento, determinan la transmisin a EL INVERSIONISTA de todos los Derechos de Crdito sin reserva ni limitacin alguna. EL INVERSIONISTA recibir del propio sistema el contrato de la cesin a su favor hecha por EL PROVEEDOR.
                                    </p>
         ");
            WriteLiteral(@"                           <p class=""text-justify"">
                                        <u><b>CLUSULA DCIMA PRIMERA: </b></u> Para los efectos del presente Contrato, EL INVERSIONISTA seala como su domicilio el  indicado en el registro electrnico del Sistema Tufactoring; hasta tanto las partes intervinientes en la operacin no se notifiquen por escrito los cambios de domicilio, todas las comunicaciones que se practiquen en los domicilios antes citados, surtirn plenamente sus  efectos.
                                    </p>
                                    <p class=""text-justify"">
                                        <u><b>CLUSULA DCIMA SEGUNDA: </b></u> Para todos los efectos del presente contrato, sus derivados y consecuencias, se elige como domicilio especial aquel de la suscripcin, aceptacin o adhesin.
